import './NotFound.css';
import error from '../../Assets/images/error.svg';


export default function NotFound() {



  return <>
  <div class="row">
    <div class="col-lg-6">
        <div class="card alif">
        <img src={error} alt="error" className=' text mx-auto' />
        </div>
    </div>
</div>


  </>;
}
